  \"Wireless Batteryless Remote Sensors for Automated Monitoring, Control, and Inspection
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\": 3\n\t},\n\t\"groups\":
